const Index = () => (
  <div>
    <div className="nav">
    test
    </div>
    <p>Hello World!</p>

  <style jsx global>{`
  body {
    background-color: hsl(0, 0%, 7%);
    min-height: 75rem;
    padding-top: 4.5rem;
    margin: 0px;
  }

  .topbar {
  backface-visibility: hidden;
  border-bottom: 1px solid #e6ecf0;
  border-bottom: 1px solid rgba(0,0,0,0.05);
  position: fixed;
  top: 0;
  right: 0;
  left: 0;
  z-index: 1000;
  }

  .global-nav{
    border-bottom: 1px solid rgba(0,0,0,0.25);
    height: 56px;
    position: relative;
    width: 100%;
  }

  .nav {
    position: fixed;
    top: 0;
    right: 0;
    left: 0;
    z-index: 1030;
    background: #272727;
    height: 56px;
    padding: 0 16px;
    display: flex;
    -ms-flex-direction: row;
    -webkit-flex-direction: row;
    flex-direction: row;
    -ms-flex-align: center;
    -webkit-align-items: center;
    align-items: center;
    -ms-flex-pack: justify;
    -webkit-justify-content: space-between;
    justify-content: space-between;
  }
`}</style>
</div>
)

export default Index
